class Solution:
    def polycarp(self, s: str, b: List[int]) -> str:
        def get_next(i):
            if i == len(s): return -1
            if s[i] == '0': return get_next(i+1)
            return b[ord(s[i])-ord('a')] + 1

        def get_prev(i):
            if i == len(s): return -1
            if s[i] == '0': return get_prev(i-1)
            return b[ord(s[i])-ord('a')] + 1

        def backtrack(i, j):
            if i == j: return [i]
            res = []
            for k in range(i, j):
                if s[i:k+1].isupper(): return res + backtrack(k+1, j)
                if s[i:k+1].islower(): return res + backtrack(i, k)
            return res + backtrack(i, j+1)

        return ''.join(backtrack(0, len(s)))

