class Solution:
    def findRestaurants(self, time: List[int], K: int) -> List[int]:

        res = []
        time.sort(reverse=True)

        while time:

            pre_time = time.pop(0)

            if pre_time > 0:
                for i in range(len(time)):
                    if time[i] <= pre_time:
                        time[i] = 0
                        break
                    else:
                        res.append(i)

            if not time:
                res.append(0)

        return res

