class Solution:
    def coinChange(self, coins: List[int], amount: int) -> int:

        dp = [amount for i in range(amount)]

        def dfs(idx, cur_dp):

            if idx == len(coins):
                return cur_dp[-1]

            cur_dp[idx] = -1

            for i in range(len(coins)):
                if i < len(coins):
                    if dp[i] > 0:
                        dp[i] = min(cur_dp[:], dp[:i] + [dp[i] - coins[i]])

            if dp[-1] >= 0:
                return dp[-1]
            else:
                return -1

        return dfs(0, dp)

